	(1387,147,'sections_3_content','<h2>Om högskoleresturange</h2>\r\n<p class=\"p1\"><span class=\"s1 preamble\">Vivamus euismod tempus lacus in fermentum. Etiam aliquet purus vel nisl fringilla tempor a eget nisi. Phasellus ante tellus, vulputate id nisl et</span><span class=\"s1\"><span class=\"preamble\">ornare fermentum libero.</span> </span></p>\r\n<p class=\"p1\"><span class=\"s1\">Morbi elementum congue ante, nec laoreet massa imperdiet a. Proin congue hendrerit bibendum. Pellentesque dictum orci purus, non ullamcorper augue volutpat eget. Interdum et malesuada fames ac ante ipsum primis in faucibus. Sed condimentum ante sit amet urna mollis dapibus. Vivamus consectetur leo eget gravida sodales. Cras facilisis ut ligula non porttitor. Duis blandit volutpat eros, at convallis dui pulvinar quis. Praesent sed nunc vitae orci lacinia finibus.</span></p>'),
