	(1,1,'2018-12-11 14:44:27','2018-12-11 13:44:27','<!-- wp:paragraph -->\n<p>Välkommen till WordPress. Detta är ditt första inlägg. Du kan redigera det eller ta bort det. Sedan är det bara att börja skriva!</p>\n<!-- /wp:paragraph -->','Hej världen!','','publish','open','open','','hej-varlden','','','2018-12-11 14:44:27','2018-12-11 13:44:27','',0,'http://hors.local/?p=1',0,'post','',1),
	(2,1,'2018-12-11 14:44:27','2018-12-11 13:44:27','<!-- wp:paragraph -->\r\n<h2>Lorem ipsum</h2>\r\n<p>Detta är en exempelsida. Den skiljer sig från ett blogginlägg genom att den finns kvar på samma plats och kommer att visas i din webbplatsnavigering (i de flesta teman). De flesta börjar med en Om-sida som presenterar dem för potentiella besökare. Den skulle t.ex kunna ha följande innehåll:</p>\r\n<blockquote>\r\n<p>Lorem ipsum dolor sit amet</p>\r\n<p><cite class=\"cite\">- Sandra</cite></p>\r\n</blockquote>\r\n<p>[button title=\"Test knapp\" id=\"2\" color=\"primary\" /]</p>\r\n<p>&nbsp;</p>\r\n<!-- /wp:paragraph -->','Start','','publish','closed','closed','','start','','','2019-01-09 12:53:18','2019-01-09 11:53:18','',0,'http://hors.local/?page_id=2',0,'page','',0),
	(3,1,'2018-12-11 14:44:27','2018-12-11 13:44:27','<!-- wp:heading --><h2>Vilka vi är</h2><!-- /wp:heading --><!-- wp:paragraph --><p>Vår webbplatsadress är: http://hors.local.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Vilka personuppgifter vi samlar in och varför vi samlar in dem</h2><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>Kommentarer</h3><!-- /wp:heading --><!-- wp:paragraph --><p>När besökare lämnar kommentarer på webbplatsen samlar vi in de uppgifter som visas i kommentarsformuläret samt besökarens ip-adress och user agent-sträng som hjälp för detektering av skräpmeddelanden.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>En anonymiserad sträng som skapats utifrån din e-postadress (även kallat hash-värde) kan komma att sändas till tjänsten Gravatar för att avgöra om du finns registrerad där. Integritetspolicyn för tjänsten Gravatar finns på https://automattic.com/privacy/. När din kommentar har godkänts kommer din profilbild att visas publikt tillsammans med din kommentar.</p><!-- /wp:paragraph --><!-- wp:heading {\"level\":3} --><h3>Media</h3><!-- /wp:heading --><!-- wp:paragraph --><p>Om du laddar upp bilder till webbplatsen bör du undvika att ladda upp bilder där EXIF-data inkluderar data från GPS-lokalisering.  Besökare till webbplatsen kan ladda ned och ta fram alla positioneringsuppgifter från bilder på webbplatsen.</p><!-- /wp:paragraph --><!-- wp:heading {\"level\":3} --><h3>Kontaktformulär</h3><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>Cookie-filer</h3><!-- /wp:heading --><!-- wp:paragraph --><p>Om du lämnar en kommentar på vår webbplats kan du välja att spara ditt namn, din e-postadress och webbplatsadress i cookie-filer. Detta är för din bekvämlighet för att du inte ska behöva fylla i dessa uppgifter igen nästa gång du skriver en kommentar. Dessa cookie-filer gäller i ett år.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>Om du har ett konto och loggar in på denna webbplats kommer vi att skapa en tillfällig cookie-fil för att kontrollera om din webbläsare accepterar cookie-filer. Denna cookie-fil innehåller ingen personligt identifierbar information och försvinner när du stänger din webbläsare.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>När du loggar in kommer vi dessutom att skapa flera cookie-filer för att spara information om din inloggning och dina val för utformning av skärmlayouten. Cookie-filer för inloggning gäller i två dagar och cookie-filer för layoutval gäller i ett år. Om du kryssar i ”Kom ihåg mig” kommer din cookie att finnas kvar i två veckor. Om du loggar ut från ditt konto kommer cookie-filerna för inloggning att tas bort.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>Om du redigerar eller publicerar en artikel kommer en extra cookie-fil att sparas i din webbläsare. Denna cookie-fil innehåller inga personuppgifter utan anger endast inläggs-ID för den artikel du just redigerade. Den gäller under 1 dygn.</p><!-- /wp:paragraph --><!-- wp:heading {\"level\":3} --><h3>Inbäddad innehåll från andra webbplatser</h3><!-- /wp:heading --><!-- wp:paragraph --><p>Artiklar på denna webbplats kan innehålla inbäddat innehåll (exempelvis videoklipp, bilder, artiklar o.s.v.). Inbäddat innehåll från andra webbplatser beter sig precis på samma sätt som om besökaren har besökt den andra webbplatsen.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>Dessa webbplatser kan samla in uppgifter om dig, använda cookie-filer, bädda in ytterligare spårning från tredje part och övervaka din interaktion med sagda inbäddade innehåll, inklusive spårning av din interaktion med detta inbäddade innehåll om du har ett konto och är inloggad på webbplatsen i fråga.</p><!-- /wp:paragraph --><!-- wp:heading {\"level\":3} --><h3>Analys</h3><!-- /wp:heading --><!-- wp:heading --><h2>Vilka vi delar dina data med</h2><!-- /wp:heading --><!-- wp:heading --><h2>Hur länge vi behåller era uppgifter</h2><!-- /wp:heading --><!-- wp:paragraph --><p>Om du skriver en kommentar kommer kommentaren och dess metadata att sparas utan tidsgräns. Anledningen till detta är att vi behöver kunna hitta och godkänna uppföljningskommentarer automatiskt och inte lägga dem i kö för granskning.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>För användare som registrerar sig på er webbplats (om sådana finns) sparar vi även de personuppgifter de anger i sin användarprofil. Alla användare kan se, redigera eller radera sina personuppgifter när som helst (med undantaget att de inte kan ändra sitt användarnamn). Även webbplatsens administratörer kan se och redigera denna information.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Vilka rättigheter du har över dina data</h2><!-- /wp:heading --><!-- wp:paragraph --><p>Om du har ett konto eller har skrivit några kommentarer på denna webbplats kan du begära en exportfil med de personuppgifter vi har om dig, inklusive alla uppgifter du har gett oss. Du kan också begära att vi tar bort alla personuppgifter vi har om dig. Detta omfattar inte eventuella uppgifter som vi är tvungna att spara av administrativa, legala eller säkerhetsändamål.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Vart vi skickar dina upgifter</h2><!-- /wp:heading --><!-- wp:paragraph --><p>Kommentarer från besökare kanske kontrolleras via en automatiserad tjänst för detektering av skräppost.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Din kontaktinformation</h2><!-- /wp:heading --><!-- wp:heading --><h2>Ytterligare information</h2><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>Hur vi skyddar din information</h3><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>Vilka procedurer vi har för dataläckor</h3><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>Från vilka utomstående parter vi tar emot data</h3><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>Vilket automatiserat beslutsfattande och/eller profilskapande vi gör med våra användaruppgifter</h3><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3> Branschkrav om delgivning av information</h3><!-- /wp:heading -->','Integritetspolicy','','draft','closed','open','','Integritetspolicy','','','2018-12-11 14:44:27','2018-12-11 13:44:27','',0,'http://hors.local/?page_id=3',0,'page','',0),
